import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  .iphone-body{
    height: 475px;
    width: 240px;
    background-color: white;

    margin: auto;
    border-width: 1px;
    border-color: lightgray;
    border-style: solid;
    border-radius: 25px;
  }

  .iphone-screen{
    height: 366px;
    width: 210px;
    /* margin-top: 25px; */
    background-color: black;
  }

  .center{
    margin-left: auto;
    margin-right: auto;
  }
`;

class Iphone extends Component{
  render() {
    return (
      <Wrapper>
        <div className="iphone-body">
          <div className="iphone-sensor" />
          <div className="iphone-camera" />
          <div className="iphone-speaker" />
          <div className="iphone-screen center"/>
        </div>  
      </Wrapper>
    );
  }
}

export { Iphone };
